// App.tsx
import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect, Routes } from 'react-router-dom';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import Dashboard from './pages/Dashboard';

const isAuthenticated = true; // Placeholder for authentication status

const App: React.FC = () => {
  return (
    <Routes>
        <Route path="/signin" element={SignIn} />
        <Route path="/signup" component={SignUp} />
        <PrivateRoute path="/dashboard" component={Dashboard} />
        <Redirect to="/signin" />
    </Routes>
  );
};

const PrivateRoute: React.FC<{ component: React.FC; path: string }> = ({
  component: Component,
  ...rest
}) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        isAuthenticated ? <Component {...props} /> : <Redirect to="/signin" />
      }
    />
  );
};

export default App;
